// Order.js
import React from 'react';

const Order = (props) => {
  console.log(props); // Log props to inspect what's being passed

  const { cartItems = [] } = props.location.state || {};

  return (
    <div>
      <h2>Ordered Items</h2>
      <ul>
        {cartItems.map(item => (
          <li key={item.id}>
            <p>Name: {item.name}</p>
            <p>Description: {item.description}</p>
            <p>Price: ${item.price}</p>
            {/* You can display more details if needed */}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Order;
